import "./style.css";

function Skills () {

 return(
    <div className="skills">
      
       <div className="tittle">
        <h2>Front-end</h2>
       </div>

       <div className="skill">
         <p>Html
            <span className="level">90</span>
         </p>
         
       </div>

    </div>
 )
}

export default Skills;
